import { stroykaApi } from '../stroyka.api';
import { DocumentModel, ProductModel } from '../../@types/models';


const injectedDiscount = stroykaApi.injectEndpoints({
    endpoints: (builder) => ({
        getDocumentation: builder.query<DocumentModel[], void>({
            query: () => ({
                url: 'documentation/',
            }),
        }),
    }),
    overrideExisting: false,
})

export const { useGetDocumentationQuery } = injectedDiscount;
